import React, { useState, useEffect } from "react";
import axios from "axios";


const Product = () => {
        const [product, setProduct] = useState({data:null});
        useEffect(() => {
          getProduct();
        }, []);
      
        const getProduct = () => {
          axios
            .get("products.json")
            .then((response) => {
              setProduct(response.data);
            })
            .catch((error) => {
              console.log(error);
            });
        };

    
    return (
        <div>
            {product.data.name}
        </div>
    );
};

export default Product;
